import React, { Component } from "react";

export class AddTodo extends Component {
  render() {
    return (
      <div>
        <form>
          <input type="text" placeholder="Add Todo..." />
          <input type="submit" value="Submit" />
        </form>
      </div>
    );
  }
}

export default AddTodo;
